INSERT INTO public."dAuction2_option_mc" (id, idd, option_text, correct, explanation_text, url, pic_height, pic_width, question_id) VALUES (79, 1, 'each Retailer has 10 as UNITS DEMANDED.', false, 'This is incorrect as then only 40 out of the total of 43 units would be divided over the Retailers.', '', '125', '500', 18);
