INSERT INTO public."dAuction2_option_mc" (id, idd, option_text, correct, explanation_text, url, pic_height, pic_width, question_id) VALUES (83, 1, 'The Retailer (or Producer) can offer to sell (buy back) the excess of units in Stage 2 until the Retailer (or Producer) has exactly the same number as UNITS DEMANDED.', true, 'This is correct. A Retailer will not be credited for holding extra units above the UNITS DEMANDED, and can thus earn some extra profit by selling the extra units. A Producer that has sold more units than the number of UNITS DEMANDED increases his profit by buying back units when the price for these units is below the Producer''s production costs.', '', '125', '500', 19);
INSERT INTO public."dAuction2_option_mc" (id, idd, option_text, correct, explanation_text, url, pic_height, pic_width, question_id) VALUES (84, 2, 'When a Retailers (or Producer) has more units than the number of UNITS DEMANDED in Stage 2, nothing can be done and the Retailer (or Producer) must just accept that they lose a little bit of profit here.', false, 'This is incorrect as both Retailers and Producers are allowed to sell and buy in both Stage 1 and Stage 2. They can thus try to change the number of units sold or bought until it is EXACTLY equal to the number of UNITS DEMANDED is divided as equally as possible over the Retailers', '', '125', '500', 19);
INSERT INTO public."dAuction2_option_mc" (id, idd, option_text, correct, explanation_text, url, pic_height, pic_width, question_id) VALUES (85, 3, 'This is incorrect as both Retailers and Producers are allowed to sell and buy in both Stage 1 and Stage 2. They can thus try to change the number of units sold or bought until it is EXACTLY equal to the number of UNITS DEMANDED is divided as equally as possible over the Retailers.', false, 'The MARKET UNITS DEMANDED is divided as equally as possible over the Retailers.', '', '125', '500', 19);
INSERT INTO public."dAuction2_option_mc" (id, idd, option_text, correct, explanation_text, url, pic_height, pic_width, question_id) VALUES (86, 4, 'A Producer can always still in Stage 2 offer to buy back the excess units. However, a Retailer in Stage 2 cannot reduce the number of units it bought by offering to sell units.', false, 'This is incorrect as both Retailers and Producers are allowed to sell and buy in both Stage 1 and Stage 2. They can thus try to change the number of units sold or bought until it is EXACTLY equal to the number of UNITS DEMANDED is divided as equally as possible over the Retailers.', '', '125', '500', 19);
